import React from 'react'
import Form from './../components/Form'
import ListTable from '../components/ListTable'
import {Layout} from 'antd'


class Home extends React.Component {

    constructor(props){
        super(props)
        this.state = {
            list : []
        }
    }

    onChange = objectForm => {
        var {object} =this.state
        object.push(objectForm)
        this.setState({
            object : object
        })
        console.log(object)
    }
  

    render() {


        var objectForm= this.state.object
        // console.log(objectForm)

        return (
            <Layout>
                <Form onChange={this.onChange}/>
                <ListTable objectForm = {objectForm}/>
            </Layout>

        )
    }
}

export default Home
